import React from 'react';
import { Head, Logo, Nav, Search } from "./styles";
import Link from "next/link";

const Header = () => {
  return (
    <Head>
      <Logo>
      <Link href="/">
        <img src="./images/chordi.png" alt="" />
      </Link>
      </Logo>
      <Nav>
        <ul>
          <li>
            <a href="">canciones</a>
          </li>
          <li>
            <a href="">acordes</a>
          </li>
        </ul>
      </Nav>
      <Search>
        <input type="text" placeholder="buscar" />
        <input type="submit" value="" />
      </Search>
    </Head>
  );
};

export default Header;
